      SELECT DISTINCT + + col0 FROM tab1 (FORMAT parquet) cor0 WHERE NOT + 90 IN ( 33, + 16 + - col0, - 35, - 62, + - col2, - - col2, col2 );
  - name: tab1

outputs:
  - name: q5455.out
    data: |
      51
      85
      91
